const generateInput = (n) => {
    const nums = [];
    let count = 0;
    for (let i = 1; count < n; i++) {
        for (let j = 0; j < i && count < n; j++) {
            nums.push(i);
            count++;
        }
    }
    nums.sort(() => 0.5 - Math.random());
    return [nums, Math.floor(Math.sqrt(n))];
};
